package Sort;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

/**
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 * 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
 */
public class 有效的字母异位词_224 {
    public static void main(String[] args) {
        System.out.println(isAnagram("",
                ""));
    }

    public static boolean isAnagram(String s, String t) {
        if(s.equals(t)) {
            return true;
        }
        if(s.length() != t.length()) {
            return false;
        }

        HashMap<String, Integer> hashMap_s = new HashMap<>();
        for(int i = 0; i < s.length(); i++) {
            if(!hashMap_s.containsKey(s.charAt(i) + "")) {
                hashMap_s.put(s.charAt(i) + "", 1);
            }else {
                hashMap_s.put(s.charAt(i) + "", hashMap_s.get(s.charAt(i) + "") + 1);
            }
        }

        HashMap<String, Integer> hashMap_t = new HashMap<>();
        for(int i = 0; i < t.length(); i++) {
            if(!hashMap_t.containsKey(t.charAt(i) + "")) {
                hashMap_t.put(t.charAt(i) + "", 1);
            }else {
                hashMap_t.put(t.charAt(i) + "", hashMap_t.get(t.charAt(i) + "") + 1);
            }
        }

        System.out.println(hashMap_s);
        System.out.println(hashMap_t);

        Iterator<Map.Entry<String, Integer>> it = hashMap_s.entrySet().iterator();
        while (it.hasNext()) {
            Map.Entry<String, Integer> next = it.next();
            if(!next.getValue().equals(hashMap_t.get(next.getKey()))) {
                return false;
            }

            // ==符号在基本运算中表较的是值，在引用类型中比较的是内存中的地址
//            if(next.getValue() != hashMap_t.get(next.getKey())) {
//                return false;
//            }
        }
        return true;
    }
}
